import setupSocket  from 'api/socket'

export const fetchData=()=>async dispath =>{
    dispath({type:'DATA_OPEN'});
    try{
        const data = await setupSocket(dispath);
        console.log(data)
        }
        catch (err){
        dispath({
            type: 'FETCH_PHONES_FAILURE',
            payload: err,
            error: true

        })
    }
};